import React, { useState } from 'react'
import './index.css'


const Topbar = (event={hide}) => {

const  [hide, sethide]= useState();
const show_hide=()=>{
    sethide(!hide)
}

  return (
    <div className='top'>

<button onClick={ show_hide}>
    click me
</button>
    </div>


  )
}

export default Topbar
